import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import Home from './Componets/Home/Home';

function App() {
  return (
    <>
      <Router>
        <Switch>
          <Route exact path='/Home' component={Home} />
        </Switch>
      </Router>
    </>
  );
}

export default App;
